// ABTestCreator.tsx
import React, { useState } from 'react';
import ABTestService from '../../services/api';

interface ABTestFormData {
  sample_size: number; // The number of individuals to participate in the A/B test
  start_date: string; // The start date of the A/B test
  variant_identifier: string; // Identifier for the variant version
  control_identifier: string; // Identifier for the control version
  end_date: string; // The end date of the A/B test
  variant_segment: number; // Segment size for the variant version
  control_segment: number; // Segment size for the control version
  visitors: number; // Number of visitors for the test
}

const CreateTest: React.FC = () => {
  
  const [formData, setFormData] = useState<ABTestFormData>({
    sample_size: 0,
    start_date: '',
    variant_identifier: '',
    control_identifier: '',
    end_date: '',
    variant_segment: 0,
    control_segment: 0,
    visitors: 0,
  });

  //handleInputChange 
  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

    const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    try {
      // Make the API call to create the AB test using the form data
      await ABTestService.createTest(formData);
      alert('Test created successfully');
    } catch (error) {
      console.error('Error creating test:', error);
      alert('Failed to create test');
    }
  };



  return (
    <form className="form" onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="sample_size">Sample Size</label>
        <input
          type="number"
          id="sample_size"
          name="sample_size"
          value={formData.sample_size}
          onChange={handleInputChange}
          placeholder="Enter the number of individuals to participate in the A/B test"
        />
      </div>
      <div className="form-group">
        <label htmlFor="start_date">Start Date</label>
        <input
          type="date"
          id="start_date"
          name="start_date"
          value={formData.start_date}
          onChange={handleInputChange}
          placeholder="Enter the start date of the A/B test"
        />
      </div>
      <div className="form-group">
        <label htmlFor="variant_identifier">Variant Identifier</label>
        <input
          type="text"
          id="variant_identifier"
          name="variant_identifier"
          value={formData.variant_identifier}
          onChange={handleInputChange}
          placeholder="Enter the identifier for the variant version of the A/B test"
        />
      </div>
      <div className="form-group">
        <label htmlFor="control_identifier">Control Identifier</label>
        <input
          type="text"
          id="control_identifier"
          name="control_identifier"
          value={formData.control_identifier}
          onChange={handleInputChange}
          placeholder="Enter the identifier for the control version of the A/B test"
        />
      </div>
      <div className="form-group">
        <label htmlFor="end_date">End Date</label>
        <input
          type="date"
          id="end_date"
          name="end_date"
          value={formData.end_date}
          onChange={handleInputChange}
          placeholder="Enter the end date of the A/B test"/>
  </div>
  <div className="form-group">
  <label htmlFor="variant_segment">Variant Segment</label>
  <input
         type="number"
         id="variant_segment"
         name="variant_segment"
         value={formData.variant_segment}
         onChange={handleInputChange}
         placeholder="Enter the segment size for the variant version"
       />
  </div>
  <div className="form-group">
  <label htmlFor="control_segment">Control Segment</label>
  <input
         type="number"
         id="control_segment"
         name="control_segment"
         value={formData.control_segment}
         onChange={handleInputChange}
         placeholder="Enter the segment size for the control version"
       />
  </div>
  <div className="form-group">
  <button type="submit" className="btn-submit">
  Create Test
  </button>
  </div>
  </form>
  );
  };
  
  export default CreateTest;
